<?php

// URL del Webservice
$urlWS = 'https://domain.com/phpWebservice.php';

$imagenPostData = 'data:image/jpeg;base64,';

//Initializing CURL
$ch = curl_init();

//Setting up CURL option
$options = array(
      CURLOPT_POST => 1,
      CURLOPT_URL => $urlWS,
		  CURLOPT_HEADER => 'Content-type: text/xml',
		  CURLOPT_RETURNTRANSFER => 1,
      CURLOPT_POSTFIELDS => http_build_query(array('imagen' => $imagenPostData))
    ); 
	
// Charging options
curl_setopt_array($ch, $options);

// Excecuting CURL and capturing XML result on $xmlUrl
    if( ! $xmlUrl = curl_exec($ch))
    {
        trigger_error(curl_error($ch));
    } 

// CLosing CURL
curl_close($ch);

// Creating XML output var
$xml = new SimpleXMLElement($xmlUrl);

// Printing Result
echo $xml->result;
